import React, { Component } from 'react';


class Document extends React.Component {
	constructor(props){
		console.log("In Document");
		console.log(props.data);
	}


	render() {
		return (
			 <div>
			 <table>
			 <thead>
			 <tr>{this.getHeader()}</tr>
			 </thead>
			 <tbody>
			 {this.getRowsData()}
			 </tbody>
			 </table>
			 </div> 
		 );
	 }
}



export default Document;
